import React from 'react'

const Navbar = () => {
  return (
    <div className='bg-green-500 '>
    <div className='h-10 flex px-16 items-center'>
      <p className='text-white font-bold font-sans'>Employee Manager</p>
    </div>
  </div>
  );
}

export default Navbar;
